export function FormularioBienvenidad(params) {

    return (
        <>
            <div id="formulario personas">
                <h2>formulario de bienvenidad</h2>
                <p>Nombre </p>
                <input type="text"></input>
                <p>Apellido </p>
                <input type="text"></input>
                <p>Telefono </p>
                <input type="text"></input>
                <br></br>
                <input type="su"></input>
                

            </div>

        </>

    );

}
